import React, { Component } from 'react';

class CreatePage extends Component {
    render() {
        return (
            <div>
                <h2> Add a New Tourist Place</h2>
                <div className="container">
                    <label>
                        Name:
                        <input type="text" name="name" />
                    </label>
                    <input type="submit" value="Submit" />
                </div>
            </div>
        );
    }
}

export default CreatePage;
